        if len(vertices) == 0:
            return
        if starting_point not in vertices:
            return
        for i in range(len(vertices)):
            if self.adjacency_matrix[vertices[i]][starting_point] == 1:
                return True
            else:
                if self.dfs(vertices[:i] + vertices[i+1:], starting_point):
                    return True
        return False

    def find_path(self, starting_point):
        for i in range(len(self.adjacency_matrix)):
