@dataclass
class Grid:
    grid: Dict[int, Tuple[int, int]]

    @classmethod
    def from_deque(cls, deque: Deque[int]) -> Grid:
        grid = {deque.popleft(): (0, 0)}
        for value in deque:
            grid[value] = (grid[value][0] + 1, 0)
            grid[value] = (grid[value][0], grid[value][1] + 1)
        return Grid(grid)


@dataclass
