from icontract import require, ensure, DBC


class Array(DBC, tuple):
    @require(lambda self: len(self) >= 1)
    @require(lambda self: all(isinstance(x, int) for x in self))
    def __add__(self, other: 'Array') -> 'Array':
        """self + other

        The `other` argument can either be an `Array`, or a single integer.
        """
        if isinstance(other, int):
            other = Array([other])
        else:
            assert isinstance(other, Array)
        return Array(self.tolist() + other.tolist())

    @require(lambda self: len(self) >= 1)
    @require(lambda self: all(isinstance(x, int) for x in self))
    def __sub__(self, other: 'Array') -> 'Array':
        """self - other

        The `other` argument can either be an `Array`, or a single integer.
        """
        if isinstance(other, int):
            other = Array([other])
        else:
            assert isinstance(other, Array)
        return Array(self.tolist() - other.tolist())

    @require(lambda self: len(self) >= 1)
    @require(lambda self: all(isinstance(x, int) for x in self))
    def __mul__(self, other: int) -> 'Array':
        """self * other

        The `other` argument can either be an `int`, or a single integer.
        """
        if isinstance(other, int):
            other = Array([other])
        else:
            assert isinstance(other, Array)
        return Array(self.tolist() * other.tolist())

    def __truediv__(self, other: int) -> 'Array':
        """self / other

        The `other` argument can either be an `int`, or a single integer.
        """
        if isinstance(other, int):
            other = Array([other])
        else:
            assert isinstance(other, Array)
        return Array(self.tolist() // other.tolist())


