from typing import List
import math

class Point:
    def __init__(self, x, y):
        self.x = x
        self.y = y

    def __str__(self):
        return f"({self.x}, {self.y})"

    def __repr__(self):
        return f"Point({self.x}, {self.y})"

    def __eq__(self, other):
        return (self.x, self.y) == (other.x, other.y)

    def __lt__(self, other):
        return (self.x, self.y) < (other.x, other.y)

    def __hash__(self):
        return hash((self.x, self.y))


class Rectangle:
    def __init__(self, p1: Point, p2: Point, p3: Point, p4: Point):
        self.p1 = p1
        self.p2 = p2
        self.p3 = p3
        self.p4 = p4

    def __str__(self):
        return f"Rectangle({self.p1}, {self.p2}, {self.p3}, {self.p4})"

    def __repr__(self):
        return f"Rectangle({self.p1}, {self.p2}, {self.p3}, {self.p4})"

    def __eq__(self, other):
        return (self.p1, self.p2, self.p3, self.p4) == (other.p1, other.p2, other.p3, other.p4)

    def __lt__(self, other):
        return (self.p1, self.p2, self.p3, self.p4) < (other.p1, other.p2, other.p3, other.p4)

    def __hash__(self):
        return hash((self.p1, self.p2, self.p3, self.p4))

    def get_area(self):
        x1, y1 = self.p1.x, self.p1.y
        x2, y2 = self.p2.x, self.p2.y
        x3, y3 = self.p3.x, self.p3.y
        x4, y4 = self.p4.x, self.p4.y

        return abs((x1 * (y2 - y3) + x2 * (y3 - y1) + x3 * (y1 - y2)) / 2)

    def contains_point(self, point: Point):
        x1, y1 = self.p1.x, self.p1.y
        x2, y2 = self.p2.x, self.p2.y
        x3, y3 = self.p3.x, self.p3.y
        x4, y4 = self.p4.x, self.p4.y

        # compare with each of the sides of the rectangle
        if x1 <= point.x <= x2 and y1 <= point.y <= y2:
            return True
        if x2 <= point.x <= x3 and y2 <= point.y <= y3:
            return True
        if x3 <= point.x <= x4 and y3 <= point.y <= y4:
            return True
        if x4 <= point.x <= x1 and y4 <= point.y <= y1:
            return True

        return False

