class HuffmanCoding:
    def __init__(self, text: str):
        self.text = text
        self.frequency_dict = {}
        self.root = None

    def calculate_frequency(self):
        counter = Counter(self.text)
        for k, v in counter.items():
            self.frequency_dict[k] = v

    def create_tree(self):
        queue = []
        for k, v in self.frequency_dict.items():
            node = Node(k, v)
            queue.append(node)
        queue = sorted(queue, key=lambda x: x.freq)
        while len(queue) > 1:
            node_left = queue.pop(0)
            node_right = queue.pop(0)
            node_parent = Node(None, node_left.freq + node_right.freq)
            node_parent.left = node_left
            node_parent.right = node_right
            queue.append(node_parent)
            queue = sorted(queue, key=lambda x: x.freq)
        self.root = queue[0]

    def huffman_encoding(self):
        self.calculate_frequency()
        self.create_tree()
        encoded_text = ''
        for char in self.text:
            encoded_text += self.get_code(self.root, char)
        return encoded_text

    def get_code(self, root: Node, char: str):
        if root.char is not None:
            return root.char
        if root.left.freq > root.right.freq:
            return '0' + self.get_code(root.left, char)
        return '1' + self.get_code(root.right, char)

    def huffman_decoding(self, encoded_text: str):
        decoded_text = ''
        current_node = self.root
        for bit in encoded_text:
            if bit == '0':
                current_node = current_node.left
            else:
                current_node = current_node.right
            if current_node.char is not None:
                decoded_text += current_node.char
                current_node = self.root
        return decoded_text

