class Direction(Enum):
    UP = 0
    DOWN = 1


class Line(Enum):
    Y = 0
    X = 1


class Point(ABC):

    def __init__(self, line: Line, value: Optional[int]) -> None:
        self._line = line
        self._value = value

    def __hash__(self) -> int:
        return hash(self._line)

    def __repr__(self) -> str:
        return str(self._value)

    @abstractmethod
    def __eq__(self, other: Any) -> bool:
        pass

    @abstractmethod
    def __lt__(self, other: Any) -> bool:
        pass

    @abstractmethod
    def __add__(self, other: Any) -> Any:
        pass

    def _compare(self, other: Any) -> int:
        if self._line == other._line:
            return self._value - other._value
        elif self._line == Line.X:
            return self._value - other._line.value
        else:
            return self._line.value - other._value

    def __gt__(self, other: Any) -> bool:
        return not self < other

    def __lt__(self, other: Any) -> bool:
        return not self > other

    def __ge__(self, other: Any) -> bool:
        return self > other or self == other

    def __le__(self, other: Any) -> bool:
        return self < other or self == other


class Coordinate(Point):

    def __init__(self, line: Line, value: Optional[int]) -> None:
        super().__init__(line, value)

    def __add__(self, other: Any) -> Any:
        if isinstance(other, Direction):
            return Coordinate(self._line, self._value + 1 if self._line == Direction.UP else self._value - 1)
        return NotImplemented

    def __eq__(self, other: Any) -> bool:
        if isinstance(other, Coordinate):
            return self._line == other._line and self._value == other._value
        return False

    def __hash__(self) -> int:
        return hash(self._line) * 37 + hash(self._value)

    def __lt__(self, other: Any) -> bool:
        return self._compare(other) < 0


class Spot(Coordinate):

    def __init__(self, line: Line, value: Optional[int]) -> None:
        super().__init__(line, value)

    def __eq__(self, other: Any) -> bool:
        if isinstance(other, Spot):
            return self._line == other._line and self._value == other._value
        return False

    def __hash__(self) -> int:
        return super().__hash__()

    def __lt__(self, other: Any) -> bool:
        return self._compare(other) < 0


class Passenger(ABC):

    def __init__(self, spots: Optional[List[Spot]] = None) -> None:
        self._spots = spots or []

    def __repr__(self) -> str:
        return '\n'.join(str(spot) for spot in self._spots)

    def __eq__(self, other: Any) -> bool:
        return isinstance(other, Passenger) and self._spots == other._spots

    def __hash__(self) -> int:
        return hash(tuple(self._spots))

    def __lt__(self, other: Any) -> bool:
        return self._spots < other._spots

    def __le__(self, other: Any) -> bool:
        return self._spots <= other._spots

    def __gt__(self, other: Any) -> bool:
        return self._spots > other._spots

    def __ge__(self, other: Any) -> bool:
        return self._spots >= other._spots

    @abstractmethod
    def __iadd__(self, other: Any) -> Any:
        pass


class PassengerStart(Passenger):

    def __init__(self, spots: Optional[List[Spot]] = None) -> None:
        super().__init__(spots)

    def __iadd__(self, other: Any) -> Any:
        if isinstance(other, Passenger):
            return self._spots + other._spots
        elif isinstance(other, Direction):
            return self._spots + [Spot(other, 0)]
        else:
            raise TypeError
        return self


class PassengerEnd(Passenger):

    def __init__(self, spots: Optional[List[Spot]] = None) -> None:
        super().__init__(spots)

    def __iadd__(self, other: Any) -> Any:
        if isinstance(other, Passenger):
            return self._spots + other._spots
        elif isinstance(other, Direction):
            return self._spots + [Spot(other, 1)]
        else:
            raise TypeError
        return self


class NoPassenger(Passenger):

    def __init__(self, spots: Optional[List[Spot]] = None) -> None:
        super().__init__(spots)

    def __iadd__(self, other: Any) -> Any:
        if isinstance(other, Passenger):
            return self._spots
        elif isinstance(other, Direction):
            return self._spots + [Spot(other, -1)]
        else:
            raise TypeError
        return self


class PassengerHolder:

    def __init__(self, passenger: Optional[Passenger] = None) -> None:
        self._passenger = passenger or NoPassenger

