from collections import Counter
from itertools import combinations

class CombinationIterator:
    def __init__(self, characters: str, combinationLength: int):
        self.combinations = list(combinations(characters, combinationLength))
        self.combinations.sort()
        self.index = 0

    def next(self) -> str:
        next = self.combinations[self.index]
        self.index += 1
        return ''.join(next)

    def hasNext(self) -> bool:
        return self.index < len(self.combinations)

class Solution:
    def getMaximumProfit(self, N: int, F: List[List[int]], P: List[int]) -> int:
        if N == 1:
            return P[0]
        p_dict = Counter(P)
        p_list = [i for i in p_dict]
        p_list.sort()
        ans = 0
        for num in p_list:
            ans += num
            if num < 0:
                break

        F = list(zip(*F))
        if F[0][0] == 0:
            F[0] = list(set(F[0]))
            F[0].sort()

        length = len(F[0])

        for i in range(N):
            count = Counter(F[i])
            if count[0] == 0:
                continue
            max_count = max(count.values())
            if max_count > 1:
                for j in range(length):
                    if F[i][j] == 0:
                        continue
                    else:
                        ans += max_count * (p_dict[F[i][j]] - 1)
                        F[i][j] = 0
        return ans

