from advent_of_code_puzzle import ProblemParser

Altar = namedtuple("Altar", ["upper", "middle", "lower"])


class AltarBuilder:
    def __init__(self, parts: List[int]) -> None:
        self.parts = list(parts)

    def build_altar(self) -> Altar:
        if len(self.parts)!= 3:
            raise Exception("Incorrect number of parts")

        def build_altar_helper(first: int, last: int) -> Altar:
            if first >= last:
                return Altar(first, first, first)
            elif last - first == 1:
                if self.parts[first] <= self.parts[last]:
                    return Altar(first, last, last)
                else:
                    return Altar(last, last, first)
            else:
                mid = (last - first) // 2 + first
                return Altar(
                    min(build_altar_helper(first, mid).upper, self.parts[mid]),
                    build_altar_helper(mid, last).middle,
                    max(build_altar_helper(first, mid).lower, self.parts[mid]),
                )

        return build_altar_helper(0, len(self.parts) - 1)

    def build_altar_i(self, i: int) -> Altar:
        return Altar(
            min(self.build_altar(i).upper, self.parts[i]),
            self.build_altar(i).middle,
            max(self.build_altar(i).lower, self.parts[i]),
        )


