"""
The Knapsack problem is a combinatorial optimization problem, in which we select a subset of items from a set of items that are all equally weighted.
An item is the element in the set, and the weight of the item is the value of that element. For example, if we are selecting a subset of two items, then we would only have two weights – the weight of the first item and the weight of the second item. The problem is to find the set of items that will give us the maximum sum. The sum of the items we select is also known as the total weight of the set.
We can solve the Knapsack problem using Dynamic Programming, but we will solve it using recursion. We will be using the knapsack problem to solve the all-pairs shortest-path problem. We will be giving a graph and we will be asking it to find the shortest distance between two points. This is known as the all-pairs shortest-path problem.

The pseudocode is as follows:
function knapsack(W, wt, val, n):
    if n = 0 or W = 0:
        return 0
    if wt[n - 1] > W:
        return knapsack(W, wt, val, n - 1)
    else:
        return max(val[n - 1] + knapsack(W - wt[n - 1], wt, val, n - 1),
                   knapsack(W, wt, val, n - 1))

The time complexity of the above algorithm is exponential. It’s exponential because the recursive calls grow exponentially with depth. So the time complexity is O(2^n). The space complexity is also O(2^n).

Time Complexity = O(2^n)
Space Complexity = O(2^n)

