        self.adjacent[(deer.x, deer.y)].add((deer.x + direction, deer.y + direction, deer.t + 1))
        self.adjacent[(deer.x, deer.y)].add((deer.x - direction, deer.y - direction, deer.t + 1))
        deer.x += direction
        deer.y += direction
        deer.t += 1
        self.travelled += 1

