from queue import Queue
from typing import List
import sys

class Solution:
    def __init__(self):
        self.max = None
        self.min = None
        self.permutation = []
        self.permutations = []
        self.result = None

    def process(self, line: str) -> None:
        line = int(line)
        if self.max is None or self.max < line:
            self.max = line
        if self.min is None or self.min > line:
            self.min = line

    def find_permutation(self):
        while not self.queue.empty():
            element = self.queue.get()
            if element == "1":
                self.permutation.append(1)
            elif element == "2":
                self.permutation.append(2)
            elif element == "3":
                self.permutation.append(3)
            elif element == "4":
                self.permutation.append(4)
            elif element == "5":
                self.permutation.append(5)
            elif element == "6":
                self.permutation.append(6)
            elif element == "7":
                self.permutation.append(7)
            elif element == "8":
                self.permutation.append(8)
            elif element == "9":
                self.permutation.append(9)
            elif element == "0":
                self.permutation.append(0)

    def generate_permutations(self, line: str) -> None:
        line = int(line)
        if line <= 9:
            self.permutation.append(line)
        else:
            for i in range(1, line + 1):
                if i == 1:
                    self.queue.put("1")
                elif i == 2:
                    self.queue.put("2")
                elif i == 3:
                    self.queue.put("3")
                elif i == 4:
                    self.queue.put("4")
                elif i == 5:
                    self.queue.put("5")
                elif i == 6:
                    self.queue.put("6")
                elif i == 7:
                    self.queue.put("7")
                elif i == 8:
                    self.queue.put("8")
                elif i == 9:
                    self.queue.put("9")
                elif i == 0:
                    self.queue.put("0")

    def find_permutation_brute_force(self):
        for line in sys.stdin:
            if len(self.permutation) == 9:
                self.permutations.append(self.permutation[:])
            self.generate_permutations(line)
            self.find_permutation()

    def permute(self, nums: List[int]) -> None:
        """
        1. Enqueue '1' to self.queue
        2. Enqueue '2' to self.queue
        3. Enqueue '3' to self.queue
        4. Enqueue '4' to self.queue
        5. Enqueue '5' to self.queue
        6. Enqueue '6' to self.queue
        7. Enqueue '7' to self.queue
        8. Enqueue '8' to self.queue
        9. Enqueue '9' to self.queue
        10. Enqueue '0' to self.queue
        11. Use self.queue.queue.get() to get the element of self.queue.
        12. Do the same for all elements in the self.queue.
        13. Reset the self.queue
        """
        self.queue = Queue()
        self.permutation = []
        self.permutations = []
        self.result = None
        self.find_permutation_brute_force()
        self.permutations.sort()
        self.result = self.permutations[0]
        for i in range(1, len(self.permutations)):
            if self.permutations[i]!= self.result:
                self.result = -1
                break

    def test(self):
        assert self.permute("2\n4\n6\n7\n13") == "9 6 10 8 4 7 3 1 5 2"


