from math import inf
from typing import List


class Node:
    def __init__(self, value=None):
        self.value = value
        self.left = None
        self.right = None


class BinarySearchTree:
    def __init__(self):
        self.root = None

    def insert(self, value):
        if self.root is None:
            self.root = Node(value)
        else:
            self._insert(value, self.root)

    def _insert(self, value, cur_node):
        if value < cur_node.value:
            if cur_node.left is None:
                cur_node.left = Node(value)
            else:
                self._insert(value, cur_node.left)
        elif value > cur_node.value:
            if cur_node.right is None:
                cur_node.right = Node(value)
            else:
                self._insert(value, cur_node.right)
        else:
            print('Value is already in the tree')

    def in_order_traversal(self):
        if self.root is None:
            return []
        return self._in_order_traversal(self.root, [])

    def _in_order_traversal(self, cur_node, array):
        if cur_node is None:
            return array
        self._in_order_traversal(cur_node.left, array)
        array.append(cur_node.value)
        self._in_order_traversal(cur_node.right, array)
        return array

    def pre_order_traversal(self):
        if self.root is None:
            return []
        return self._pre_order_traversal(self.root, [])

    def _pre_order_traversal(self, cur_node, array):
        if cur_node is None:
            return array
        array.append(cur_node.value)
        self._pre_order_traversal(cur_node.left, array)
        self._pre_order_traversal(cur_node.right, array)
        return array

    def post_order_traversal(self):
        if self.root is None:
            return []
        return self._post_order_traversal(self.root, [])

    def _post_order_traversal(self, cur_node, array):
        if cur_node is None:
            return array
        self._post_order_traversal(cur_node.left, array)
        self._post_order_traversal(cur_node.right, array)
        array.append(cur_node.value)
        return array

    def find_node(self, value):
        if self.root is None:
            return None
        return self._find_node(value, self.root)

    def _find_node(self, value, cur_node):
        if value < cur_node.value and cur_node.left is not None:
            return self._find_node(value, cur_node.left)
        if value > cur_node.value and cur_node.right is not None:
            return self._find_node(value, cur_node.right)
        if value == cur_node.value:
            return cur_node
        return None

    def remove_node(self, value):
        if self.root is None:
            return None
        self._remove_node(self.root, value)

    def _remove_node(self, cur_node, value):
        if cur_node is None:
            return None
        if value < cur_node.value and cur_node.left is not None:
            cur_node.left = self._remove_node(cur_node.left, value)
        elif value > cur_node.value and cur_node.right is not None:
            cur_node.right = self._remove_node(cur_node.right, value)
        elif value == cur_node.value:
            if cur_node.left is None and cur_node.right is None:
                return None
            elif cur_node.left is None:
                return cur_node.right
            elif cur_node.right is None:
                return cur_node.left
            else:
                current = cur_node.right
                while current.left is not None:
                    current = current.left
                cur_node.value = current.value
                cur_node.right = self._remove_node(cur_node.right, current.value)
        return cur_node

    def find_kth_smallest_element(self, k):
        return self._find_kth_smallest_element(self.root, k)

    def _find_kth_smallest_element(self, cur_node, k):
        if cur_node is None:
            return -inf
        left_count = self._get_node_count(cur_node.left)
        if left_count + 1 == k:
            return cur_node.value
        elif left_count + 1 > k:
            return self._find_kth_smallest_element(cur_node.left, k)
        else:
            return self._find_kth_smallest_element(cur_node.right, k - left_count - 1)

    def _get_node_count(self, node):
        if node is None:
            return 0
        return 1 + self._get_node_count(node.left) + self._get_node_count(node.right)

