This is a classic dynamic programming problem.
We first attempt to find a solution that tries to fill in every position.
We can probably reduce the problem to a smaller version by fixing one color.
We use Dynamic Programming to solve this problem.
In the worst case we have N colors to choose from, and K is small enough, so that we can find the number of the ways to paint them each.
The length of the solution is N*K.
If we have a solution that has N positions,
we can choose to paint the balls in position i in color 0.
In this case we have to fill in the rest of the positions with colors 1 to K-1.
We can combine the two solutions and obtain the number of the ways to paint the balls.
We need to compare K-1 colors, and the number of the solutions that have K-1 colors.
We can compute this from the solutions with K colors.

class Solution {
public:
    int solution(vector<int>& balls, int colors) {
        // How many colors are there?
        int k = balls.size();
        // Dynamic programming data
        vector<vector<int>> count(k, vector<int>(colors+1, 0));
        // Base case
        count[0][0] = 1;
        for (int i = 1; i <= k; i++)
            for (int j = 1; j <= colors; j++)
                count[i][j] = count[i-1][j-1] + count[i-1][j];
        // Compute
        int ans = 0;
        for (int i = 1; i <= k; i++) {
            for (int j = 0; j <= colors; j++)
                ans += count[k-i][j];
        }
        return ans;
    }
};

