import os
from typing import List
import collections

class Solution:
    def solve(self, grid: List[str]):
        houses: List[str] = []
        spies: List[str] = []
        for line in grid:
            for house in line:
                if house == 'S':
                    spies.append(house)
                elif house == 'H':
                    houses.append(house)

        # build a dict of houses to their distances
        dist_to_houses: dict = collections.defaultdict(int)
        for house in houses:
            visited = {}
            self.explore(house, visited, dist_to_houses)

        # build a dict of spies to their distances
        dist_to_spies: dict = collections.defaultdict(int)
        for spy in spies:
            visited = {}
            self.explore(spy, visited, dist_to_spies)

        return max(dist_to_spies.values())

    def explore(self, pos: str, visited: dict, dist_to: dict) -> None:
        if pos in visited:
            return
        visited[pos] = True
        if pos in dist_to:
            return
        curr_dist = 0
        for neighbor in self.getNeighbors(pos):
            self.explore(neighbor, visited, dist_to)
            curr_dist = max(curr_dist, dist_to[neighbor])
        dist_to[pos] = curr_dist + 1

    def getNeighbors(self, pos: str) -> List[str]:
        x, y = pos
        neighbors = []
        for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
            new_x, new_y = x + dx, y + dy
            if new_x < 0 or new_x >= len(grid) or new_y < 0 or new_y >= len(grid[0]):
                continue
            neighbors.append(f'{new_x},{new_y}')
        return neighbors

