import sys

class UnionFind:
    def __init__(self, n):
        self.parent = [i for i in range(n)]

    def union(self, a, b):
        a_parent = self.find(a)
        b_parent = self.find(b)
        if a_parent == b_parent:
            return False
        self.parent[b_parent] = a_parent
        return True

    def find(self, a):
        if self.parent[a] == a:
            return a
        self.parent[a] = self.find(self.parent[a])
        return self.parent[a]
